// // ÂºïÂÖ•ReactÊ†∏ÂøÉÂ∫ìÂíåË∑ØÁî±ÁªÑ‰ª∂
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

// ÂºïÂÖ•Â≠êÁªÑ‰ª∂ÂíåÊ†∑ÂºèÊñá‰ª∂
import HangSengChart from './HangSengChart'; // ÊÅíÁîüÊåáÊï∞ÂõæË°®ÁªÑ‰ª∂
import './../App.css'; // ÂºïÂÖ•Êàë‰ª¨‰øÆÊîπËøáÁöÑCSSÔºåÂÆÉÂåÖÂê´‰∫ÜGridÂ∏ÉÂ±ÄÊ†∑Âºè

/**
 * Â∏ÆÂä©ÂáΩÊï∞ÔºöÊ†ºÂºèÂåñÊ∂®Ë∑åÂπÖÁôæÂàÜÊØî
 * @param {number} change - Ê∂®Ë∑åÂπÖÊï∞ÂÄº
 * @returns {JSX.Element} - ËøîÂõûÂ∏¶È¢úËâ≤ÂíåÊ≠£Ë¥üÂè∑ÁöÑJSXÂÖÉÁ¥†
 */
const formatChange = (change) => {
  // Â§ÑÁêÜÊï∞ÊçÆ‰∏çÂ≠òÂú®ÁöÑËæπÁºòÊÉÖÂÜµ
  if (change === null || change === undefined) {
    return <span style={{ color: 'gray' }}>N/A</span>;
  }

  // Âà§Êñ≠Ê∂®Ë∑å
  const isPositive = parseFloat(change) >= 0;
  // ÂÆö‰πâ‰∏ì‰∏öÁöÑÊ∂®ÔºàÁªøÔºâË∑åÔºàÁ∫¢ÔºâÈ¢úËâ≤
  const color = isPositive ? '#26a69a' : '#ef5350';
  // ‰∏∫Ê≠£Êï∞Ê∑ªÂä† '+' Âè∑
  const sign = isPositive ? '+' : '';
  // Ê†ºÂºèÂåñ‰∏∫Â∏¶‰∏§‰ΩçÂ∞èÊï∞ÁöÑÁôæÂàÜÊØîÂ≠óÁ¨¶‰∏≤
  const formattedChange = `${sign}${parseFloat(change).toFixed(2)}%`;

  return <span style={{ color, fontWeight: 'bold' }}>{formattedChange}</span>;
};

function StockList() {
  // ÂÆö‰πâÁªÑ‰ª∂Áä∂ÊÄÅ
  const [topMovers, setTopMovers] = useState([]); // Â≠òÂÇ®Top 10ËÇ°Á•®Êï∞ÊçÆ
  const [loading, setLoading] = useState(true);   // Âä†ËΩΩÁä∂ÊÄÅ
  const [error, setError] = useState(null);       // ÈîôËØØÁä∂ÊÄÅ

  // ‰ΩøÁî®useEffectÂú®ÁªÑ‰ª∂Âä†ËΩΩÊó∂‰ªéÂêéÁ´ØAPIËé∑ÂèñÊï∞ÊçÆ
  useEffect(() => {
    fetch('/api/top-movers')
      .then(res => {
        if (!res.ok) {
          throw new Error('Failed to fetch top movers data from the server.');
        }
        return res.json();
      })
      .then(data => {
        setTopMovers(data);
        setLoading(false);
      })
      .catch(error => {
        console.error("Fetch error:", error);
        setError(error.message);
        setLoading(false);
      });
  }, []); // Á©∫‰æùËµñÊï∞ÁªÑÁ°Æ‰øùÊ≠§effect‰ªÖËøêË°å‰∏ÄÊ¨°

  // Ê†πÊçÆÁªÑ‰ª∂Áä∂ÊÄÅÔºàÂä†ËΩΩ„ÄÅÈîôËØØ„ÄÅÊàêÂäüÔºâÊ∏≤Êüì‰∏çÂêåÁöÑÂÜÖÂÆπ
  const renderContent = () => {
    if (loading) {
      return <div className="loading-message">Loading AI Predicted Top 10 Movers...</div>;
    }
    if (error) {
      return <div className="error-message" style={{ color: '#ef5350' }}>Error: {error}</div>;
    }
    if (topMovers.length === 0) {
      return <div className="info-message">No prediction data available for today. Please run the prediction script.</div>;
    }

    // ÊàêÂäüËé∑ÂèñÊï∞ÊçÆÂêéÔºåÊ∏≤ÊüìÂàóË°®
    // Ëøô‰∏™ulÂàóË°®ÁöÑÂ∏ÉÂ±ÄÁî± App.css ‰∏≠ÁöÑ 'top-movers-list' Á±ªÊéßÂà∂ (CSS Grid)
    return (
      <ul className="top-movers-list">
        {topMovers.map((stock, index) => (
          <li key={stock.ticker}>
            <Link to={`/stock/${stock.ticker}`}>
              <span className="ticker-name">

                {/* === Ê†∏ÂøÉ‰øÆÊîπÁÇπ === */}
                {/* Â¶ÇÊûúÊòØÁ¨¨‰∏Ä‰∏™ÂÖÉÁ¥† (index === 0)ÔºåÂàôÊòæÁ§∫ÁéãÂÜ†ÂõæÊ†á */}
                {index === 0 && <span className="crown-icon">üëë</span>}

                {stock.ticker}
              </span>
              <span className="ticker-change">
                {/* ‰ΩøÁî®Â∏ÆÂä©ÂáΩÊï∞Êù•Ê†ºÂºèÂåñÊòæÁ§∫ÁöÑÊ∂®Ë∑åÂπÖ */}
                {formatChange(stock.change_percent)}
              </span>
            </Link>
          </li>
        ))}
      </ul>
    );
  };

  // ÁªÑ‰ª∂ÁöÑÊúÄÁªàËøîÂõûÂÜÖÂÆπ
  return (
    <div className="stock-list-container">
      <HangSengChart />
      <hr className="divider"/> {/* Âª∫ËÆÆÁªôhrÊ∑ªÂä†‰∏Ä‰∏™Á±ªÂêçÔºåÊñπ‰æøÂú®CSS‰∏≠ÂçïÁã¨ËÆæÁΩÆÊ†∑Âºè */}

      <h2 className="list-title">AI Predicted Top 10 Movers for Next Trading Day</h2>

      {/* Ë∞ÉÁî®ÂÜÖÂÆπÊ∏≤ÊüìÂáΩÊï∞ */}
      {renderContent()}
    </div>
  );
}

export default StockList;
